package com.xmy.secondskill.vo;import com.xmy.secondskill.entity.Goods;import java.util.Date;/** * @author xmy * @date 2021/3/27 8:38 下午 */public class GoodsVo extends Goods{    private Double miaoshaPrice;    private Integer stockCount;    private Date startDate;    private Date endDate;    public GoodsVo() {    }    public Double getMiaoshaPrice() {        return miaoshaPrice;    }    public void setMiaoshaPrice(Double miaoshaPrice) {        this.miaoshaPrice = miaoshaPrice;    }    public Integer getStockCount() {        return stockCount;    }    public void setStockCount(Integer stockCount) {        this.stockCount = stockCount;    }    public Date getStartDate() {        return startDate;    }    public void setStartDate(Date startDate) {        this.startDate = startDate;    }    public Date getEndDate() {        return endDate;    }    public void setEndDate(Date endDate) {        this.endDate = endDate;    }}